import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Navbar from "./components/Navbar";
import Hero from "./components/Hero";
import Projects from "./components/Projects";
import Skills from "./components/Skills"; // Example additional route
import Resume from "./components/Resume"; // Example additional route
import './App.css';
import './index.css';  

const App = () => (
  <Router>
    <div className="overflow-y-auto h-screen">
      {/* Navbar stays fixed */}
      <Navbar />

      <Routes>
        {/* Home route */}
        <Route
          path="/"
          element={
            <>
              {/* Wrap sections with ID for smooth scrolling */}
              <div id="hero">
                <Hero />
              </div>
              <div id="projects">
                <Projects />
              </div>
            </>
          }
        />
        {/* Other routes */}
        <Route path="/skills" element={<Skills />} />
        <Route path="/resume" element={<Resume />} />
      </Routes>
    </div>
  </Router>
);

export default App;
